import React from "react";
import Iframe from "react-iframe";
import './App.css'

const Home = () => {
  return (
    <div className = 'home__wrapper' >
        form
      <Iframe
        width="450px"
        height="450px"
        id="idrameId"
        className="iframe"
        display="initial"
        position="relative"
      />
    </div>
  );
};

export default Home;
